import React, { Component } from "react";
import Navbar from "./navbar";
import Web3 from "web3";

class App extends Component {
  state = {
    accounts: Web3.eth.getAccounts(),
  };
  render() {
    return (
      <React.Fragment>
        <Navbar accounts={this.state.accounts} />
      </React.Fragment>
    );
  }
}

export default App;
